import React from "react";
import { StyleSheet, View, Image } from "react-native";

const headlogo = require("../../assets/download.png");
const header = require("../../assets/header.png");

const Background = () => {
  return (
    <View style={styles.headerContainer}>
      <View style={styles.imageContainer}>
        <Image
          source={headlogo}
          style={styles.headStyle}
          resizeMode="contain"
        />
      </View>
      <Image
        source={header}
        style={styles.headerImageStyle}
        resizeMode="contain"
      />
    </View>
  );
};

const styles = StyleSheet.create({
  headerContainer: {
    flex: 1,
    backgroundColor: "#F2F2F2",
    justifyContent: "center",
    alignItems: "center",
    top: 920, // Set the height according to your design
    position: "relative",
    backgroundColor: "pink",
  },
  headStyle: {
    width: 210,
    height: 300,
    marginBottom: 20, // Adjust the margin bottom according to your design
    backgroundColor: "red",
  },
  imageContainer: {
    position: "absolute",
    top: 0, // Adjust the top position if needed
    left: -50,
    backgroundColor: "yellow",
  },
  headerImageStyle: {
    width: 310,
    height: 150, // Set the height of your header image
    marginTop: -600,
  },
});

export default Background;
